script: |
  super -f text -I q7345.spq | sort > q7345.out

inputs:
  - name: q7345.spq
    data: |
      SELECT DISTINCT - - col2 * + + 50 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 + + ( col2 ) BETWEEN NULL AND + - col2 - col0 + ( 12 ) - 84;
  - name: tab1

outputs:
  - name: q7345.out
    data: |
      2950
      3400
      4800
